var title_f38_36_39500="Valproate interactions with other AEDs";
var content_f38_36_39500=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F53463&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F53463&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Some interactions between valproate and other antiepileptic drugs*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"20%\">",
"     </colgroup>",
"     <colgroup span=\"2\" width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Interacting drugs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effects (probable mechanism)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Valproate, with:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Carbamazepine",
"       </td>",
"       <td>",
"        Decreased valproate effect and possible increased toxicity (increased metabolism and formation of toxic metabolite)",
"       </td>",
"       <td>",
"        Monitor valproate concentrations and clinical status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Carbamazepine toxicity (decreased metabolism of carbamazepine epoxide and displacement from binding)",
"       </td>",
"       <td>",
"        Monitor carbamazepine and carbamazepine epoxide concentrations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clonazepam",
"       </td>",
"       <td>",
"        Clonazepam may precipitate absence status (mechanism not established)",
"       </td>",
"       <td>",
"        Monitor clinical status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Ethosuximide",
"       </td>",
"       <td>",
"        Possible ethosuximide toxicity (decreased metabolism)",
"       </td>",
"       <td>",
"        Monitor ethosuximide concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Possible decreased valproate effect (mechanism not established)",
"       </td>",
"       <td>",
"        Monitor valproate concentration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lamotrigine",
"       </td>",
"       <td>",
"        Possible lamotrigine toxicity (decreased metabolism; glucuronidation)",
"       </td>",
"       <td>",
"        Decrease lamotrigine dose; monitor lamotrigine concentrations and clinical status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Oxcarbazepine",
"       </td>",
"       <td>",
"        Possible decreased oxcabazepine concentration (increased metabolism)",
"       </td>",
"       <td>",
"        Monitor oxcarbazepine concentrations and clinical status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Phenytoin",
"       </td>",
"       <td>",
"        Phenytoin toxicity (displacement from binding and decreased metabolism)",
"       </td>",
"       <td>",
"        Monitor phenytoin concentrations and clinical status (unbound concentrations may be more helpful than total)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Possible decreased valproate effect and increased toxicity (increased metabolism and formation of toxic metabolite)",
"       </td>",
"       <td>",
"        Monitor clinical status and valproate serum concentrations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Topiramate",
"       </td>",
"       <td>",
"        Possible increased hepatotoxic effect of valproate (mechanism not established)",
"       </td>",
"       <td>",
"        Monitor clinical status",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     *",
"     <strong>",
"      NOTE: Not all potential interactions are listed.",
"     </strong>",
"     Additional interactions of antiepileptic drugs and management suggestions may be determined using the drug interactions tool (Lexi-Interact Online) included in UpToDate. The Lexi-Interact program can be accessed from the UpToDate new search tab or through the individual drug information topics in the section on Drug interactions.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Drugs for Epilepsy. Treatment guidelines from The Medical Letter 2008; 6(70):37-46. Copyright &copy; 2008 The Medical Letter.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
