"      <td class=\"subtitle2_left\" colspan=\"3\">",
"       Slightly increased risk",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Underweight (&lt;85 percent of ideal body weight); for most individuals this is equivalent to body mass index (BMI) &le;20.",
"      </td>",
"      <td>",
"       2-3",
"      </td>",
"      <td>",
"       29",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Cigarette smoker (1 pack/day)",
"      </td>",
"      <td>",
"       2-3",
"      </td>",
"      <td>",
"       30,31",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Chest x-ray with solitary granuloma",
"      </td>",
"      <td>",
"       2",
"      </td>",
"      <td>",
"       20,32",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\">",
"       Low risk",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Infected person, no known risk factor, normal chest x-ray (\"low risk reactor\")",
"      </td>",
"      <td>",
"       1",
"      </td>",
"      <td>",
"       33",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\">",
"       Very low risk",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Positive booster (two step test) with no other known risk factor and normal chest x-ray)",
"      </td>",
"      <td>",
"       0.5",
"      </td>",
"      <td>",
"       Extrapolated from 33 and 34",
"      </td>",
"     </tr>",
